import React from 'react'

const TodosList = ({todos, setTodos}) => {
  return (
  <div>
    {todos.map((todo) => (
        <li className='list-item' key={todo.id}>
            <input 
                type="text" 
                value={todo.title} 
                className="list" 
                onChange={(event) => event.preventDefault()}
            />
            <div>
                <button className=''>

                </button>
            </div>
        </li>
    ))}
  </div>
  );
};

export default TodosList;
